import React from "react";
import "./searchBar.css";

const searchBar = () => {
  const searchGoogle=(e)=> {
    let searchTerm = parseString(e);
    let win1 = window.open("//" + "google.com/search?q=" + searchTerm, '_blank');

  }
  return (
    <div className="searchContainer">
      <input
        type="text"
        id="header-search"
        placeholder="Search Google ..."
        name="s"
      />
      <button className="searchButton"type="submit" onClick={(e) => {searchGoogle(e)}}>Go</button>
    </div>
  );
};

export default searchBar;
